#include <iostream>

using namespace std;

// Definition for singly-linked list.
class ListNode {
public:
    int val;
    ListNode *next;
    ListNode(int x) : val(x), next(NULL) {}
};

ListNode *myMerge(ListNode *lHead, int lLen, ListNode *rHead, int rLen);
ListNode *mySort(ListNode *head, int len);
ListNode *sortList(ListNode *head);

ListNode *myMerge(ListNode *lHead, int lLen, ListNode *rHead, int rLen) {
    lHead = mySort(lHead, lLen);
    rHead = mySort(rHead, rLen);
    
    ListNode *head = NULL, *p = NULL;
    while (lHead != NULL && rHead != NULL) {
        if (head == NULL) {
            if (lHead->val < rHead->val) {
                head = lHead;
                lHead = lHead->next;
            } else {
                head = rHead;
                rHead = rHead->next;
            }
            p = head;
        } else {
            if (lHead->val < rHead->val) {
                p->next = lHead;
                lHead = lHead->next;
            } else {
                p->next = rHead;
                rHead = rHead->next;
            }
            p = p->next;
        }
        p->next = NULL;
    }
    if (lHead != NULL) {
        p->next = lHead;
    }
    if (rHead != NULL) {
        p->next = rHead;
    }
    
    return head;
}

ListNode *mySort(ListNode *head, int len) {
    if (head == NULL || head->next == NULL) {
        return head;
    }
    ListNode *lHead = head, *rHead = head, *tempNode = NULL;
    int rLen = int(len / 2);
    int lLen = len - rLen;
    int t = lLen;
    while (t != 0) {
        tempNode = rHead;
        rHead = rHead->next;
        t--;
    }
    tempNode->next = NULL;
    return myMerge(lHead, lLen, rHead, rLen);
}

ListNode *sortList(ListNode *head) {
    ListNode *t = head;
    int numOfNodes = 0;
    while (t != NULL) {
        numOfNodes++;
        t = t->next;
    }
    return mySort(head, numOfNodes);
}

